/* eslint-disable react/style-prop-object */
/* eslint-disable jsx-a11y/anchor-is-valid */
/* eslint-disable import/no-anonymous-default-export */
import { Link } from "react-router-dom";
export default (props)=>{
    return(
        
       
      <div class="row  row-cols-md-3 g-4">
      
 <div className="card">
 <img src={props.Foto} alt="300x150" width="300" height="150" />
 <div className="card-body">
   <h5 className="card-title">Toquio (Japão)</h5>
   <p className="card-text">Passagem + Hospedagem <br/> Parcele em ate 10 vezes no Cartão</p>
   <Link to="/CadastrarCliente" className="btn btn-primary">Comprar</Link>
 </div>
 </div>
 </div>
 
   
    );
}
